import React , { Component} from 'react';

import "./Help.css";
import $ from "jquery";	
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';




const options = {
  margin: 30,
  responsiveClass: true,
  nav: true,
  autoplay: false,
  navText: ["Prev", "Next"],
  smartSpeed: 1000,
  responsive: {
      0: {
          items: 1,
      },
      400: {
          items: 1,
      },
      600: {
          items: 2,
      },
      700: {
          items: 3,
      },
      1000: {
          items: 5,
      }
  },
};

export default class Help extends Component {




	render(){

		return (

			<section>
				<div className="helpWrapper col-lg-12">
					<div className="heading5">How Can We Help?</div>
						<OwlCarousel
						    className="	owl-carousel owl-theme owlCarousel"
						    loop
						    margin={10}
						    nav
						    item={2}>
						    <div class="item">

						    </div>


						</OwlCarousel>

				</div>
			</section>

			)
	}
}
